import React from "react";
import '../assets/CSS/proejects.css'
import {useGlobalState,setGlobalState} from '../components/componet.js'
import graphml from '../assets/images/ML.png'
import gif from '../assets/images/ezgif.com-crop.gif'
import mariogif from '../assets/images/mario.gif'
import Iphone from "../components/iphone";
import react from "../assets/images/react_1183672.png"
import carving from '../assets/images/carving.gif'
import seam from '../assets/images/seam.png'
import back from '../assets/images/Background-Checks1.gif'
import Computer from "../components/computer";
import web from '../assets/images/scrap.png'
import Carousel from "../components/car";
import {useEffect,useState} from 'react'
function PProject(){
    const[set] = useGlobalState('work');
    const Tch = () =>{
        setGlobalState('work',!set)
    }
    const [skillholdWidth, setSkillholdWidth] = useState(null);

    useEffect(() => {
      const skillhold = document.querySelector('.skillhold');
      const hiddenb = document.querySelector('.hiddenb');
      const hiddenc = document.querySelector('.hiddenc');
      const skilla = document.querySelector('.skill.a');
      const skillb = document.querySelector('.skill.b');
      const skillc = document.querySelector('.skill.c');

      if (skillhold) {
        const width = skillhold.getBoundingClientRect().width;
        hiddenb.style.left = `-${width/3}px`; // Set left property of hiddenb
        hiddenc.style.left = `-${width/1.5}px`;
        skilla.style.width = `${width-width/8}px`
        skillb.style.width = `${width-width/8}px`
        skillc.style.width = `${width-width/8}px`
        setSkillholdWidth(width);
      } else {
        console.error('Element with class "skillhold" not found.');
      }

      // Optional: If you want to update the width on window resize
      function handleResize() {
        if (skillhold) {
          const width = skillhold.getBoundingClientRect().width;
          hiddenb.style.left = `-${width/3}px`; // Set left property of hiddenb
            hiddenc.style.left = `-${width/1.5}px`;
            skilla.style.width = `${width-width/8}px`
            skillb.style.width = `${width-width/8}px`
            skillc.style.width = `${width-width/8}px`
          setSkillholdWidth(width);
        }
      }

      window.addEventListener('resize', handleResize);

      // Cleanup function to remove the event listener when the component unmounts
      return () => {
        window.removeEventListener('resize', handleResize);
      };

    }, []);
    return(
        <div>
            <div className="pro">
            <div className="aboutmetext">
                    <h1 className="AMT">Personal Projects</h1>
                    <div className="divider"></div>
                    <p className="aboutintro"> Here you see my personal projects</p>
                    <button className="workswitch a" onClick={Tch}> CLick to see work projects</button>
            </div>
            <div className="Projecthold">
            <div className="project1">
                <div className="pimage">
                    <div className="vertical-image"><img className='imagel' src={gif}/>
                    <div className="p1-image"></div>
                    </div>
                </div>
                <div className="text-hold">
                    <div className="description">
                    <h1 className="project-title">Perfect Snake</h1>
                    <div className="project-divider"></div>
                    <div className="type">-Machine Learning</div>
                    <div className="projxplaniation">
                        <p>This Project was my primary intro into real machine learning and properly learning how to manage DNQ agents, multiple randomly generated actions as well as a reward system. </p>

                        <p>Worked with the pytorch library in order to create my own agent class set to play the game as well as used q-learning to train behavior over each game.</p>

                        <p>Worked with the pytorch library Q-Trainer in order to store and hold previous data to commit to long and short term memory as well as present realtime analysis with matplotlib.</p>

                    </div>
                    </div>
                </div>
            </div>
            <div className="project1 z">
                <h1></h1>
                <div className="pimage">
                    <div className="vertical-image a"><img className='imagel a' src={seam}/>
                    <div className="p1-image c"></div>
                    </div>
                </div>
                <div className="text-hold a">
                    <div className="description">
                    <h1 className="project-title">Seam Carving</h1>
                    <div className="project-divider"></div>
                    <div className="type">- Software-Engineering </div>
                    <div className="projxplaniation">
                        <p>Created a command line seam carver which takes in designed width and height in order to return a carved image within that given frame.</p>

                        <p>Analyzed the pixel variance between the layers of pixels from the given photo and the a calculated energy function to return given energy values of each pixel row.</p>

                        <p>The followed the path of least energy value to remove the pixels and condense the image to the desired size</p>
                    </div>
                    </div>
                </div>
            </div>
            <div className="project1 b">
                <div className="pimageb">
                    <Computer image={web}/>
                </div>
                <div className="text-hold c">
                    <div className="description">
                    <h1 className="project-title">Web Scrapping</h1>
                    <div className="project-divider"></div>
                    <div className="type">-Data Science/ Software-Engineering </div>
                    <div className="projxplaniation">
                        <p>Worked on a real world applicable data sample in order to analysis margins of profitability for chocolate production</p>

                        <p>Created a Python web scrapping software to read a nested HTML and distribute into Pandas dictionaries.</p>

                        <p>Then identified quality related material to comparatively choose the best location and price, then through Matplotlib demonstrated correlation between rating and location as well as coco percentage.</p>

                    </div>
                    </div>
                </div>
            </div>
            </div>
            <div className="sliderhold">
                <h1 className="project-title">View More Projects</h1>
                <div className="project-divider a"></div>
            </div>
            <Carousel/>
        </div>
        </div>    

    )
}

export default PProject
